<!DOCTYPE html>
<html>
<meta http-equiv='cache-control' content='no-cache'>
<meta http-equiv='expires' content='0'>
<meta http-equiv='pragma' content='no-cache'>
<head>
<title>Page Title</title>

<script type="text/javascript">
	
function imageLoadTime() {
	var lapsed = navSupport ? window.performance.now() : Date.now() - pageStart;
	document.getElementById("imgTiming").innerHTML = ((lapsed) / 1000).toFixed(2)
}
var pageStart = Date.now();
var navSupport = !(!('performance' in window) || !('timing' in window.performance) || !('navigation' in window.performance));

</script>
</head>
<body onload="imageLoadTime();">

<style>
.image-size {
	width:10px;
	height:10px;
}
.time-color {
	color: #FF9933;
}
</style>

<h1>HTTP1.1 Test</h1>
<div>
	<p>
		<span>Load time: </span>
		<span class="time-color" id="imgTiming"></span>
		<span>Sec</span>
	</p>
	
</div>
<script type="text/javascript">
	for(var i = 1 ; i < 996 ; i++){
		var img = document.createElement("IMG");
		if( i >= 1 && i < 10 ){
			img.src = "http://http11-image-webserver.cberry.xzy/circle00" + i + ".png";
		}else if( i >= 10 && i < 100 ){
			img.src = "http://http11-image-webserver.cberry.xzy/circle0" + i + ".png";
		}else{
			img.src = "http://http11-image-webserver.cberry.xzy/circle" + i + ".png";
		}
		img.className = "image-size";
		img.src += "?q=" + Math.random();
		document.body.appendChild(img);		
	}
</script>
